INSERT INTO `course` VALUES ('Planning your career path',' To succeed in the world of work it is essential that you match your career path to your natural strengths, passions, interests and personality.','<ul id=\"docs-internal-guid-5208a91b-70e4-43f7-a1d9-7f90ef10134a\" style=\"background-color: transparent; color: #000000; font-family: Times New Roman; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; margin-bottom: 0px; margin-top: 0px; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\">\r\n<li dir=\"ltr\" style=\"background-color: transparent; color: #000000; font-family: &amp;quot; noto sans symbols&amp;quot;; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: bold; list-style-type: disc; text-decoration: none; vertical-align: baseline; white-space: pre;\">\r\n<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> The better the natural fit between you and the requirements of your job, the more success you will experience and the more happiness you will experience in the world of work. On this course you will </span></p>\r\n</li>\r\n<ul style=\"margin-bottom: 0px; margin-top: 0px;\">\r\n<li dir=\"ltr\" style=\"background-color: transparent; color: #000000; font-family: &amp;quot; courier new&amp;quot;; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; list-style-type: disc; text-decoration: none; vertical-align: baseline; white-space: pre;\">\r\n<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">complete an extensive personality test which analyses various aspects of your personality and makes suitable career suggestions based on the results</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"background-color: transparent; color: #000000; font-family: &amp;quot; courier new&amp;quot;; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; list-style-type: disc; text-decoration: none; vertical-align: baseline; white-space: pre;\">\r\n<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">determine the actions you should be taking on a daily basis that will keep you primed and ready for potential career opportunities that could arise in the future</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"background-color: transparent; color: #000000; font-family: &amp;quot; courier new&amp;quot;; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; list-style-type: disc; text-decoration: none; vertical-align: baseline; white-space: pre;\">\r\n<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">gain clarity about your current reality and how you can use this information to help you reach your career goals and objectives sooner</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"background-color: transparent; color: #000000; font-family: &amp;quot; courier new&amp;quot;; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; list-style-type: disc; text-decoration: none; vertical-align: baseline; white-space: pre;\">\r\n<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">identify your personal assets, targets and the boundaries you will need to set to lay down a solid career path</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"background-color: transparent; color: #000000; font-family: &amp;quot; courier new&amp;quot;; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; list-style-type: disc; text-decoration: none; vertical-align: baseline; white-space: pre;\">\r\n<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">break down your portfolio to help enhance your career prospects and opportunities</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"background-color: transparent; color: #000000; font-family: &amp;quot; courier new&amp;quot;; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; list-style-type: disc; text-decoration: none; vertical-align: baseline; white-space: pre;\">\r\n<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 10.66px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">explore of further possibilities for growth and development</span></p>\r\n</li>\r\n</ul>\r\n</ul>\r\n<p><br style=\"background-color: transparent; color: #000000; font-family: Times New Roman; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\" /><u></u></p>',NULL,'Active',1,'2018-02-07 15:31:16','2018-02-07 15:31:16'),('How to prepare for an interview','To get that perfect job you need to have a resume or CV that makes an instant impression and to be able to ace the interview.','<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">To get that perfect job you need to have a resume or CV that makes an instant impression and to be able to ace the interview. The key skills required for CV writing and interview success are covered in this course. </span></p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">CV Writing</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Cover Letter</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">How to dress</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Researching for your interview</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 10.66px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Asking the right questions</span></li>\r\n</ul>',NULL,'Active',2,'2018-02-07 15:34:22','2018-02-07 15:34:22'),('Communication Skills and Teamwork',' This course will improve the way you collaborate in teams and communicate effectively so that you make an impact in your workplace.','<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> This course will improve the way you collaborate in teams and communicate effectively so that you make an impact in your workplace. Much of your professional success depends on the way your inform, persuade and build relationships at work. By the end of this course you will know how to</span></p>\r\n<ul id=\"docs-internal-guid-5208a91b-70e9-3d6a-71e4-d30835eba15f\" style=\"background-color: transparent; color: #000000; font-family: Times New Roman; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; margin-bottom: 0px; margin-top: 0px; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\">\r\n<ul style=\"margin-bottom: 0px; margin-top: 0px;\">\r\n<li dir=\"ltr\" style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; list-style-type: circle; text-decoration: none; vertical-align: baseline; white-space: pre;\">\r\n<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">determine the most appropriate format for different messages</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"background-color: transparent; color: #000000; font-family: Arial; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; list-style-type: circle; text-decoration: none; vertical-align: baseline; white-space: pre;\">\r\n<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">manage conflict in a professional and appropriate manner</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"background-color: transparent; color: #000000; font-family: Arial; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; list-style-type: circle; text-decoration: none; vertical-align: baseline; white-space: pre;\">\r\n<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">write clear, concise professional communications, including emails and calendar invitations</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"background-color: transparent; color: #000000; font-family: Arial; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; list-style-type: circle; text-decoration: none; vertical-align: baseline; white-space: pre;\">\r\n<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">design clear and persuasive PowerPoint presentations</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"background-color: transparent; color: #000000; font-family: Arial; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; list-style-type: circle; text-decoration: none; vertical-align: baseline; white-space: pre;\">\r\n<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 10.66px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> achieve team synergy by using the forming, storming, norming, and performing methodology</span></p>\r\n</li>\r\n</ul>\r\n</ul>\r\n<p><br style=\"background-color: transparent; color: #000000; font-family: Times New Roman; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\" /><u></u></p>',NULL,'Active',3,'2018-02-07 15:37:34','2018-02-19 12:55:58'),('Effective Presentation and Public Speaking',' This course will help you to develop new-found confidence in public speaking and the ability to captivate an audience.','<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> This course will help you to develop new-found confidence in public speaking and the ability to captivate an audience. By the end of this course you will know how to </span></p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Speak in public with confidence and authority</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Deliver more effective and convincing presentations</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Overcome nerves and fear of public speaking</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Project your voice to its fullest potential</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Optimise your body language</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Increase your awareness of how others see and hear you</span></li>\r\n<ul style=\"margin-bottom: 0px; margin-top: 0px;\">\r\n<li dir=\"ltr\" style=\"background-color: transparent; color: #000000; font-family: Arial; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; list-style-type: circle; text-decoration: none; vertical-align: baseline; white-space: pre;\">\r\n<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 10.66px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Engage the attention and respect of your audience</span></p>\r\n</li>\r\n</ul>\r\n</ul>\r\n<p><br style=\"background-color: transparent; color: #000000; font-family: Times New Roman; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\" /><u></u></p>',NULL,'Active',4,'2018-02-07 15:41:01','2018-02-07 15:41:01'),('Essential Time Management',' Gain the skills that help you work powerfully and use your time better. Learn core personal effectiveness skills, find out how to prioritize and schedule your time for maximum impact, develop and maintain focus, and motivate yourself to achieve extraordinary things.','<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> Gain the skills that help you work powerfully and use your time better. Learn core personal effectiveness skills, find out how to prioritize and schedule your time for maximum impact, develop and maintain focus, and motivate yourself to achieve extraordinary things. By the end of this course you will know how to:</span></p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">develop greater productivity and efficiency.</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">gain a better professional reputation.</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">experience less stress.</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 10.66px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">avoid 10 common time management mistakes</span></li>\r\n</ul>\r\n<p><br style=\"background-color: transparent; color: #000000; font-family: Times New Roman; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\" /><u></u></p>',NULL,'Active',5,'2018-02-07 15:44:15','2018-02-07 15:44:15'),('Customer Service & Managing Expectations',' From difficult clients and customers to bossy co-workers, all of us will encounter difficult people in the workplace.','<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> From difficult clients and customers to bossy co-workers, all of us will encounter difficult people in the workplace. How you deal with these situations will determine your career success. By the end of this course you will know how to;</span></p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Deal effectively with rudeness in the workplace</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Deal with difficult customers and/or clients</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Develop the good manners needed for success in the workplace</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Deal with co-workers with big egos</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 10.66px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Understand and manage