 baseline; white-space: pre-wrap;\">wants</span><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> to communicate badly. As a one stop guide to a professional\'s writing career, the class is ideal for assistants, secretaries, executives, managers, and senior managers of any company or organization. Learn about the common mistakes we make when writing a business letter. Learn how often people mistake \'affect\' for \'effect\', and \'except\' for \'accept\'. &nbsp;Learn about how to write business emails. This course covers;</span></p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">the basic do\'s and don\'ts of business communication</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">the nitty-gritty of formatting, punctuation, tone and language</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">insights into your reader\'s mind. Who are they? What do they want? How can you effectively reach out to them?</span></li>\r\n</ul>\r\n<p><br style=\