4.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">learn research and business skills </span></li>\r\n<li dir=\"ltr\" style=\"line-height: 17.59px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">build your knowledge of materials and ways of working sustainably. </span></li>\r\n<li dir=\"ltr\" style=\"line-height: 17.59px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">have an extensive portfolio of work that you can proudly present to prospective employers and clients.</span></li>\r\n</ul>\r\n<p><br style=\"background-color: transparent; color: #000000; font-family: Times New Roman; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\" /><u></u></p>',NULL,'Active',39,'2018-02-07 17:23:44','2018-02-07 17:23:44'),('Product and Service Design','Do you want to learn how to design? By undertaking this course you will learn how to use a number of key design methods to create meaningful products and services. This course is an introduction to the Design offering a model and a set of signature methods to teach you how to get from understanding the user in context to defining a meaningful design challenge and – in the end – deliver a great design! The course challenges you to experience the design process yourself and reflect on your work.','<p><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Do you want to learn how to design? By undertaking this course you will learn how to use a number of key design methods to create meaningful products and services. This course is an introduction to the Design offering a model and a set of signature methods to teach you how to get from understanding the user in context to defining a meaningful design challenge and &ndash; in the end &ndash; deliver a great design! The course challenges you to experience the design process yourself and reflect on your work. By the end of the course you will know how to:</span></p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"line-height: 17.59px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">study users in their own environment;</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 17.59px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">translate user insights into a design challenge that will spark creativity;</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 17.59px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">create a meaningful design to meet your challenge; </span></li>\r\n<li dir=\"ltr\" style=\"line-height: 17.59px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">design and to structure your projects with the support of design thinking, a model and several methods; </span></li>\r\n<li dir=\"ltr\" style=\"line-height: 17.59px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">evaluate and present your design.</span></li>\r\n</ul>\r\n<p><br style=\"background-color: transparent; color: #000000; font-family: Times New Roman; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\" /><u></u></p>',NULL,'Active',40,'2018-02-07 17:26:11','2018-02-07 17:26:11'),('General Receptionist',' As a receptionist you are an important member of the company you work for.  When clients enter your business for the first time, the person to greet them when they enter the office is the receptionist. Receptionists create the first impression that a client has of your business, whether it\'s good or bad.  You set the company tone and contribute to your company’s\' reputation.','',NULL,'Active',41,'2018-02-07 17:27:02','2018-02-07 17:27:02');
