 and maintenance performed on vehicles and other equipmentare done in accordance with the established standards to achieve maximum reliability with minimum downtime.\r\nResponsible for dispatching, routing, and tracking of delivery vehicles.\r\nManage, monitor and develop a team of drivers.\r\nEnsuring that goods are delivered timely and within the stipulated TAT\r\nEnsure that the quality and quantity of the supply of fuel, oil and lubricants are in accordance with set standards.\r\nManage and monitor the performance of fleet to achieve maximum utilization in optimizing vehicle routing and scheduling.\r\nPromptly handled all cases of vehicles HBD.\r\nPrepare all necessary papers and documentations for Accidented vehicles on the highway','2016-09-01','2016-09-01',31,16,'2018-03-16 08:26:17','2018-03-16 08:26:49'),('SNAP CREDIT','SALES MANAGER','VICTORIA ISLAND','SALES OF CREDIT SERVICE TO KEY DECISION MAKERS WITHIN AN ORGANISATION  ','2017-03-16','2017-03-16',32,17,'2018-03-16 08:28:28','2018-03-16 08:28:28'),('Cornerstone Insurance Plc','General Underwriting ','Lagos','	Studying insurance proposals and issuing out policies accordingly. \r\n	reviewing statistical data applicable to the risk to be insured\r\n	Reviewing company records regarding the application and evaluating site inspection reports.\r\n	Assessing the Financial Health of Commercial Clients \r\n	Establishing Rate/Pricing Guidelines for Policies\r\n	Negotiating with brokers and drawing up contracts.\r\n	Preparation of monthly renewal notice documents. \r\n	Completing Quality Control Reviews on Due Diligence and Final Reports\r\n	Preparing weekly report of all transactions debited. \r\n	Preparing and issuing out Bonds Documents to client.\r\n	Reviewing Expiring Policies and Reassessing Risk\r\n	Recommending Underwriting Process Improvements\r\n	Monitoring Loss Reports and Taking Appropriate Underwriting Action\r\n','2015-06-06','2015-06-06',28,18,'2018-03-16 10:46:55','2018-03-16 10:52:52'),