ds and recharge vouchers.\r\n Entry of GPS coordinates for each dealer location.\r\n Collect and enter data from prospective dealers.\r\n Verify and correct data where necessary.\r\n Upload information to designated data base.','2015-11-02','2015-11-02',197,95,'2018-04-09 16:50:50','2018-04-09 16:50:50'),('Zenith Bank','Card Product Developer','Victoria Island','1) To implement and set up new card product and enhance existing card products for flexible card usage for customers\r\n\r\n2) To Track Business opportunities of new Card schemes by applying Market Analysis and intelligence to build project aligned to the company growth strategy\r\n\r\n3) To build relationship with  key customers operating within the Financial and Technology industry with the aim to ensure promotion of card services to customers\r\n\r\n4) To create Graphical communication designed to pictorially market card products to the bank and customers','2018-01-10','2018-01-10',201,96,'2018-04-09 20:55:07','2018-04-12 12:14:27'),('Strategic Outsourcing Limited for Access Bank Plc','Direct Sales Executive','Makurdi, Benue State','','2018-04-10','2018-04-10',202,97,'2018-04-10 00:44:41','2018-04-11 00:46:06'),('LLH Nigeria Limited','Content lead','Lagos City','Content Creation\r\nHTML formatting\r\nApp Testing\r\nCommunication','2016-05-09','2016-05-09',205,98,'2018-04-10 10:21:19','2018-04-10 10:21:19'),('Riby Finance','Sales Associate','Lagos','I engage in Sales Presentation, Customer Research, Value Engagement, Ensure Customer Satisfaction, develop business development frameworks as well as make profit.','2017-08-22','2017-08-22',181,99,'2018-04-10 13:01:00','2018-04-10 13:01:00'),('First City Monument Bank','Direct Sales Agent','Abuja','Carried out Customer Research, sales presentation, Customer relationship management, account management and made profit.','2015-03-06','2015-03-06',181,100,'2018-04-10 13:01:00','2018-04-10 13:01:00'),('BUMADE GLOBAL INVESTMENT','Human Resource/Admin assistant','Ibadan','1. provide payroll information by collecting time nd attendance record\r\n2. submit employee data report by assembling, preparing and analysing data\r\n3.maintain employee information by entering and updating employment and status change data\r\n4.maintain employee confidence and protect operations by keeping human resource information confidential\r\n5. organize recruitment exercise,by collecting CV\'s,filtering CV\'S, and qualify candidates against their specs and organisation requirement. ','2015-05-04','2015-05-04',208,101,'2018-04-10 13:56:33','2018-04-10 13:56:33'),('Etop Nigeria Limited','Support Engineer','Lagos','•	Routine check on all assigned terminals within my coverage region.\r\n•	Carrying out technical upgrade on assigned terminals where the need arises.\r\n•	Attending to merchants’ complaints.\r\n•	Preparing and sending of weekly support report for assessment.\r\n•	Delivering training to banks and other clients in respect to POS terminal setup.	\r\n\r\n','2017-06-19','2017-06-19',207,102,'2018-04-10 14:53:09','2018-04-11 10:48:57'),('PHINA STORES LTD','manager','benin city, edo state','human resources\r\ncoordinator\r\norder and purchase organizer','2012-04-02','2012-04-02',210,103,'2018-04-10 17:13:19','2018-04-10 17:13:19'),('Technical College of Education','Assistant Lecturer','Kogi State','with the head of department during a project seminar organized by the department\r\n•	Worked along with the technician of the department to organize a practical session which involved the students. \r\n\r\n','2016-06-06','2016-06-06',207,104,'2018-04-11 10:48:57','2018-04-11 10:48:57'),('FTN Cocoa Processors','IT/Maintenance Engineer','Ibadan','•	Worked with Maintenance team and supervised the implementation of the daily, weekly and monthly plant’s maintenance plans which resulted in 60% reduction in machine breakdown.\r\n•	Worked with the company’s welder to fabricate few machine components, which resulted in reduction of expenses.\r\n•	Worked with the Plumbers to carry out some pipe fittings, which leads to increase in production.  \r\n•	Assisted in the installation and repair of pumps which resulted to reduction of production downtime.\r\n•	Worked with the Engineering Supervisors in the maintenance of each machines.\r\n\r\n','2013-09-02','2013-09-02',207,105,'2018-04-11 10:48:57','2018-04-11 10:48:57'),('Ha-Shem Network Services Limited		','Microsoft Intern/Client Relationship Executive','Lagos','Collection of quantitative and qualitative data from marketing campaigns. \r\nAssisted in marketing and promotional activities. \r\nResponsible for day to day client care and support. \r\nConstantly updating the clients on products update and sales promotion. \r\nEscalating more complex issues to the technical team. \r\nManagement of company’s database and customer relationship management (CRM) \r\nConduct market analysis and research. \r\nSocial media management. \r\nSupport marketing team with daily administrative tasks. ','2017-08-21','2017-08-21',214,107,'2018-04-11 15:44:54','2018-04-11 19:53:15'),('PAL Pensions','Sales Representative','Lagos','•	Business Development\r\n•	Prepared action plans and strategy for effective search of sales leads and prospective markets.\r\n•	Maintenance of action plan to transform prospects into business opportunities.\r\n•	Preparation and presentation of proposals to prospective clients.\r\n•	Registration of new clients under the Pension Reform Act 2014.\r\n','2017-04-17','2017-04-17',214,108,'2018-04-11 15:53:35','2018-04-11 19:53:15'),('First Bank Of Nigeria','Front Teller','Awka, Anambra State','Receiving and dispensing of cash','2017-07-10','2017-07-10',215,109,'2018-04-11 21:43:22','2018-04-11 21:43:22'),('Dzc capital ','Risk manager ','Ikeja, Lagos','Risk and Compliance \r\nBusiness development \r\nFinancial analysis ','2017-08-12','2017-08-12',218,110,'2018-04-12 14:22:10','2018-04-12 14:22:10'),('Ab Microfinance Bank ','Loan officer','Ikeja, Lagos','Business assessment,  loan disbursement \r\nClient relationship ','2016-04-04','2016-04-04',218,111,'2018-04-12 14:22:10','2018-04-12 14:22:10'),('Jumia, Nigeria ','Operations Officer (intern) ','Lagos State ','Supply chain Analysis ,\r\nFleet management , and inventory management. ','2017-10-02','2017-10-02',52,112,'2018-04-12 22:55:43','2018-04-12 22:55:43'),('Prepclass Nigeria limited ','Home Tutor ','Lagos State ','Teaching and counseling students to equip them for external examinations. ','2016-06-06','2016-06-06',52,113,'2018-04-12 22:55:43','2018-04-12 22:55:43'),('THE RED MUSTARD CONFECTIONARY  ',' SALES OFFICER','Lagos','•	I effectively executed our monthly sales plans, our marketing execution targets and I monitored the efficiency of our marketing channels (field marketing, Email marketing, social media marketing). With the concerted effort of my team members, I ensured our brand was promoted to our target audience which led to increased sales. \r\n•	I ensured prospective customers were enlightened about the quality of our products and persuaded them on the need to subscribe to our products and services through marketing campaigns. This amounted to the creation of new sales channels and viable business opportunities.\r\n•	My client relationship acumen coupled with my passion for sales and marketing paved the way for me to surpass sales targets and generate revenue for my employer. I carried out my duties with a high level of professionalism, and most importantly created of new business opportunity through digital marketing, referral discounts, creation of new product lines based on the suggestions from our clients. This led to the generation of referrals and good client user experience reports.\r\n•	My problem solving acumen bolstered my ability to address challenges, suggestions and complaints made by our customers. Our customers being the reason we are in business, I worked effectively to reconcile the interest of the customer with that of our company.\r\n•	I recorded bookings and inquiries from our online platforms and I ensured our customers were supported effectively.  This resulted in customer satisfaction, the generation of referrals and creation of viable business opportunities.\r\n','2017-03-01','2017-03-01',27,114,'2018-04-13 03:38:29','2018-04-13 03:38:29'),('ROSABON FINANCIAL SERVICES:  (ASSET CREATION DEPARTMENT)','SALES OFFICER','Lagos','•	I carried out direct and digital marketing and also field sales (B2C/B2B) of our credit products and services by visiting companies, Micro Businesses, Corporate employees to enlighten them on the benefits of subscribing to our products and services.\r\n•	I offered advisory services where necessary, answered inquiries and proffered solutions to customers who encountered challenges subscribing to our products and services. This in turn resulted in commendable user experience reports, Customer satisfaction and expansion of customer base through increased referrals.\r\n•	My innate sales ability enabled me pitch the sales of our micro business products to micro business owners by visiting them at their place of business to create a first contact, convince, negotiate and close sales deals.\r\n•	 I worked directly with clients by following up on client user experience reports, getting user experience feedback based on the products they were subscribed to. My working closely with clients ensured the achievement of their investment objectives and by extension resulted in increased sales and increased revenue for my employer.\r\n•	I generated daily, weekly and monthly reports indicating feed backs from emails, phone calls, transaction status and Daily customer inquiry. This served as Market research to analyze our customer strength, customer satisfaction and how we can effectively improve our products and services.\r\n•	I carried out my duties with innovation as my yardstick for performance by identifying and taking advantage of new business opportunities, creating ideas, introduction of newer viable market strategies to increase sales and generate revenue.\r\n•	I constantly engaged prospective customers via telesales, Email and social media marketing and field marketing to inform, persuade and negotiate terms with customers on credit facility subscriptions packages and their respective benefits. This in turn increased our client Market share by increased sales.\r\n•	I was often informed with the product features and modifications of our direct competitors and always pushed for modifications to make our products stand out were possible through the National Channel Manager and my direct Supervisor.\r\n•	I facilitated presentations, designed proposals and booked meetings and focus group discussions with Corporate Establishments, private groups and private Individuals via mails, blogging, online vendors and courier services. \r\n','2016-09-19','2016-09-19',27,115,'2018-04-13 03:38:29','2018-04-13 03:38:29'),('NYSC/ MINISTRY OF NIGER DELTA AFFAIRS','NYSC staff, Environmental management','F.C.T- Abuja','My responsibilities were basically clerical and did review couple of reports','2014-10-16','2014-10-16',213,117,'2018-04-13 06:52:33','2018-04-13 06:52:33'),('Sterling Bank Plc','Relationship Manager','Kaduna','Financial adviser to new of  existing customer ,\r\nOn boarding of new customers as well as maintaining relationship with existing customers','2015-06-01','2015-06-01',221,121,'2018-04-14 09:12:43','2018-04-14 09:12:43'),('Cormart (Nig)Ltd','Business development and Research Graduate Intern-l','Illupeju, Lagos','•	Creation and presentation of business plans to the  board of directors\r\n•	Carrying out technical feasibilities on newly proposed projects.\r\n•	Working closely with the sales, marketing, procurement  and accounts department to actualize business plans\r\n•	Carrying out open market surveys and research in order to develop the company\'s new products\r\n•	Brainstorming new product development ideas related to the company\'s area of specialization\r\n•	Working with the marketing and sales department to expand new product awareness\r\n•	Organizing and directing a team of interviewees during the company’s interview exercise.\r\n•	Writing reports on business activities and research.\r\n•	Writing minutes of  meetings\r\n•	Acquisition of new computer literacy skills in Microsoft excel, power point and word\r\n\r\n','2016-06-13','2016-06-13',217,122,'2018-04-14 18:17:56','2018-04-15 15:27:52'),('Adron Homes and properties   ','Marketer/Business Development officer  ','Ogba, Lagos','•	Facilitate cold and warm calls to prospective leads\r\n•	Schedule and follow through on calls with leads and current customers\r\n•	Communicate with leads and customers via email, text messages and social media platforms\r\n•	Answer all lead and customer questions accurately\r\n•	Prioritize and/or escalate lead and customer questions as needed\r\n•	Perform cost-benefit analysis for prospective customers\r\n•	Advise on appropriate purchase options\r\n•	Promote specific products as directed by upper management\r\n•	Inform leads and customers of current promotions and discounts\r\n•	Maintain positive business and customer relationships in the effort to extend customer lifetime value\r\n•	Develop strategies for more effective sales, both individually and as part of a team\r\n•	Source and work customer referrals\r\n•	Track all appointments, sales, complaints, status reports, etc. thoroughly for manager review\r\n•	Meet and/or exceed monthly and quarterly sales quotas\r\n•	Self-improve continuously by way of experience and manager feedback\r\n','2017-11-13','2017-11-13',217,123,'2018-04-14 18:17:56','2018-04-15 15:27:52'),('fache engineering limited','project engineer','ota,ogun state','project planning,design,construction, supervision and operations','2018-01-02','2018-01-02',188,124,'2018-04-16 22:33:28','2018-04-16 22:33:28'),('bravo international school,sokoto','class rooom teacher','sokotosouth,offa,old airport,sokoto','technical drawing,basic technology,mathematics and physics','2017-06-14','2017-06-14',188,125,'2018-04-16 22:33:28','2018-04-16 22:33:28'),('Oryx West Africa','Strategy and Marketing Manager','Lagos','Pipeline Generation\r\n-	Support healthy pipeline generation for long term revenue impact.\r\n-	Ensure a minimum of 4x pipeline across all product and services areas month on month.\r\n-	Maximizes spend of marketing budget.\r\n-	Identify high profile forums and opportunities.\r\nCustomer Relationship Management\r\n-	Ensuring that customers’ needs are of high priority\r\n-	Making sure that the customers are satisfied with their business solutions\r\n-	Ensuring that consultants are on customers’ sites on time to meet customers’ needs.\r\nRevenue Generation\r\n-	Support the revenue generation via campaigns, demand generation activities and events.\r\nOnline Advertisement\r\n-	Work with the sales team on effective methods of marketing products and services through demand generation activities such as email campaigns, google campaigns and social media campaigns.\r\n-	Providing the management team with analytical and progress reports of campaigns quarterly.\r\nBrand Management\r\n-	Organize and coordinate marketing events.\r\n-	Positively impacts the perception of the company.\r\n-	Manages company’s branding strategy- taking current branding guidelines, websites and practices to the next level of implementation in support of the strategy.\r\nWebsite Management\r\n-	Periodic reviews on company’s website\r\nVendor Management\r\n-	Registers vendors for procurement of branding materials.\r\n-	Contacts vendors for branding materials.\r\n-	Ensure the vendors adhere to the recommendations of the company’s brand manual.','2015-10-05','2015-10-05',193,126,'2018-04-17 08:47:06','2018-04-17 08:47:06'),('Sufficient Skills and Career Consult Ltd','Business Development Officer','Lekki, Lagos state','','2015-11-03','2015-11-03',228,127,'2018-04-19 04:30:35','2018-04-19 04:30:35'),('Ogijo Community High School','Educationist','Ogijo, Ogun state','Head of the corpers in the school serving as a Representative.\r\nTeaching and educating class students on the subject taught.\r\nA counselor and Inspiration to the students on general life matters which includes pursuing a career and dealing with life challenges.','2017-02-28','2017-02-28',230,128,'2018-04-19 14:01:28','2018-04-19 14:02:40'),('Shodex beautification and landmark limited','Customer care representative','Lagos','Attend to enquires made by customers and generation of sale report.','2018-02-02','2018-02-02',231,129,'2018-04-19 15:50:56','2018-04-19 15:50:56');
