in our society; the integrity of even senior officials is ____ .',NULL,'growing - unquestioned','endangered – disputed','pervasive - intact','rare - corrupted','rife - suspect','E',31,'2018-02-06 16:30:50','2018-02-06 16:30:50'),(2,'Today Wegener\'s theory is ____ ; however, he died an outsider treated with ____ by the scientific establishment.',NULL,'unsupported – approval','dismissed – contempt','accepted - approbation','unchallenged – disdain','unrivalled - reverence','D',32,'2018-02-06 16:30:50','2018-02-06 16:30:50'),(2,'If there is nothing to absorb the energy of sound waves, they travel on ____ , but their intensity ____ as they travel further from their source.',NULL,'erratically - mitigates','eternally - alleviates','forever - increases','steadily - stabilizes','indefinitely - diminishes','E',33,'2018-02-06 16:30:50','2018-02-06 16:30:50'),(2,'The revolution in art has not lost its steam; it ____ on as fiercely as ever.',NULL,'trudges','meanders','edges','ambles','rages','E',34,'2018-02-06 16:30:50','2018-02-06 16:30:50'),(2,' Each occupation has its own ____ ; bankers, lawyers and computer professionals, for example, all use among themselves language which outsiders have difficulty following.',NULL,'merits','disadvantages','rewards','jargon','problems','D',35,'2018-02-06 16:30:50','2018-02-06 16:30:50'),(2,'The student was extremely foolhardy; he had the ____ to question the senior professor\'s judgment.',NULL,'wisdom','temerity','interest','trepidation','condescension','B',36,'2018-02-06 16:30:50','2018-02-06 16:30:50'),(2,' Many people at that time believed that spices help preserve food; however, Hall found that many marketed spices were ____ bacteria, moulds and yeasts.',NULL,'devoid of','teeming with','improved by','destroyed by','active against','B',37,'2018-02-06 16:30:50','2018-02-06 16:30:50'),(2,'The formerly ____ waters of the lake have been polluted so that the fish are no longer visible from the surface.',NULL,'muddy','tranquil','stagnant','transparent','rancid','D',38,'2018-02-06 16:30:50','2018-02-06 16:30:50'),(2,' He was treated like a ____ and cast out from his community.',NULL,'ascetic','prodigy','prodigal','pariah','tyro','D',39,'2018-02-06 16:30:50','2018-02-06 16:30:50'),(2,'Thankfully the disease has gone into ____ ; it may not recur for many years.',NULL,'treatment','sequestration','quarantine','remission','oblivion','D',40,'2018-02-06 16:30:50','2018-02-06 16:30:50'),(3,'<p>Of the following, which is greater than &frac12; ?</p>',NULL,'2/5','4/7','4/9','5/11','6/13','B',41,'2018-02-06 16:38:44','2018-02-07 13:19:51'),(3,' If an object travels at five feet per second, how many feet does it travel in one hour?',NULL,'30','300','720','1800','18000','E',42,'2018-02-06 16:38:44','2018-02-06 16:38:44'),(3,'<p>If n is even, which of the following cannot be odd?</p>\r\n<p>1) n + 3,</p>\r\n<p>2) 3n,</p>\r\n<p>3) n&sup2; - 1</p>',NULL,'I only','II only','III only','I and II only','I, II and III','B',43,'2018-02-06 16:38:44','2018-03-20 14:24:56'),(3,'What is the average (arithmetic mean) of all the multiples of ten from 10 to 190 inclusive?',NULL,'90','95','100','105','110','C',44,'2018-02-06 16:38:44','2018-02-06 16:38:44'),(3,'A cubical block of metal weighs 6 pounds. How much will another cube of the same metal weigh if its sides are twice as long?',NULL,'48','32','24','18','12','A',45,'2018-02-06 16:38:44','2018-02-06 16:38:44'),(3,' In a class of 78 students 41 are taking French, 22 are taking German. Of the students taking French or German, 9 are taking both courses. How many students are not enrolled in either course?',NULL,'6','15','24','33','54','C',46,'2018-02-06 16:38:44','2018-02-06 16:38:44'),(3,'Helpers are needed to prepare for the fete. Each helper can make either 2 large cakes per hour, or 35 small cakes per hour. The kitchen is available for 3 hours and 20 large cakes and 700 small cakes are needed. How many helpers are required?',NULL,'10','15','20','25','30','A',47,'2018-02-06 16:38:44','2018-02-06 16:38:44'),(3,'<p>A collection contains US, Indian and British stamps. If the ratio of US to Indian stamps is 5 to 2 and the ratio of Indian to British stamps is 5 to 1, what is the ratio of US to British stamps?</p>',NULL,'5 : 1','10 : 5','15 : 2','20 : 2','25 : 2','E',48,'2018-02-06 16:38:44','2018-02-28 11:55:46'),(3,'Two sets of 4 consecutive positive integers have exactly one integer in common. The sum of the integers in the set with greater numbers is how much greater than the sum of the integers in the other set?',NULL,'4','7','8','12','it cannot be determined from the information given','D',49,'2018-02-06 16:38:44','2018-02-06 16:38:44'),(3,' If f(x) = (x + 2) / (x-2) for all integers except x=2, which of the following has the greatest value?',NULL,'f(-1)','f(0)','f(1)','f(3)','f(4)','D',50,'2018-02-06 16:38:44','2018-02-06 16:38:44'),(3,' After being dropped a certain ball always bounces back to 2/5 of the height of its previous bounce. After the first bounce it reaches a height of 125 inches. How high (in inches) will it reach after its fourth bounce?',NULL,'20','15','8','5','3.2','C',51,'2018-02-06 16:38:44','2018-02-06 16:38:44'),(3,'<p>The distance from town A to town B is five miles. C is six miles from B.&nbsp; Which of the following could be the distance from A to C?</p>\r\n<p>I. 11</p>\r\n<p>II. 1</p>\r\n<p>III. 7</p>',NULL,'I only','II only','I and II only','II and III only','I, II, or III','E',52,'2018-02-06 16:38:44','2018-03-20 14:29:16'),(3,'If pqr = 1 , rst = 0 , and spr = 0, which of the following must be zero?',NULL,'P','Q','R','S','T','D',53,'2018-02-06 16:38:44','2018-02-06 16:38:44'),(3,'-20 , -16 , -12 , -8 .... \nIn the sequence above, each term after the first is 4 greater than the preceding term. Which of the following could not be a term in the sequence?',NULL,'0','200','440','668','762','E',54,'2018-02-06 16:38:44','2018-02-06 16:38:44'),(3,'For how many integer values of n will the value of the expression 4n + 7 be an integer greater than 1 and less than 200?',NULL,'48','49','50','51','52','C',55,'2018-02-06 16:38:44','2018-02-06 16:38:44'),(3,' Six years ago Anita was P times as old as Ben was. If Anita is now 17 years old, how old is Ben now in terms of P ?',NULL,'11/P + 6','P/11 +6','17 - P/6','17/P','11.5P','A',56,'2018-02-06 16:38:44','2018-02-06 16:38:44'),(3,'12 litres of water are poured into an aquarium of dimensions 50cm length, 30cm breadth, and 40cm height. How high (in cm) will the water rise?\n(1 litre = 1000cm3)',NULL,'6','8','10','20','40','B',57,'2018-02-06 16:38:44','2018-02-06 16:38:44'),(3,' A certain animal in the zoo has consumed 39 pounds of food in six days. If it continues to eat at the same rate, in how many more days will its total consumption be 91 pounds?',NULL,'12','11','10','9','8','E',58,'2018-02-06 16:38:44','2018-02-06 16:38:44'),(3,'<p><span style=\"color: #000000; font-family: Calibri; font-size: 15px; white-space: pre-wrap; background-color: #ffffff;\">If n &ne; 0, which of the following must always be greater than n? (I) 2n (II) n&sup2; (III) 2 - n</span></p>',NULL,'I Only','II Only','I and II Only','II and III Only','None','E',59,'2018-02-06 22:10:57','2018-03-06 13:08:51'),(3,'<p><span style=\"color: #000000; font-family: Calibri; font-size: 15px; white-space: pre-wrap; background-color: #ffffff;\"><strong id=\"docs-internal-guid-3e2d1c51-dc49-4f5f-cd8d-ff0afeb7d147\" style=\"font-weight: normal;\"></strong>A 3 by 4 rectangle is inscribed in a circle. What is the circumference of the circle? Note &pi; = Pi</span></p>',NULL,'2.5π','3π','5π','4π','10π','C',60,'2018-02-06 23:16:53','2018-03-06 13:01:03'),(1,'','49045777.png','1','2','3','4','5','D',61,'2018-02-28 15:46:52','2018-02-28 15:46:52');
