INSERT INTO `job` VALUES ('Commercial HR Business Partner tested','Mondelez International LLC is a whole new company that has been reimagined with a single focus in mind: create delicious moments of joy by sharing the world’s favorite brands.\r\n\r\nLaunched on Oct. 1, 2012, and employing around 100,000 people around the world, MondelÄ\'z International comprises the global snacking and food brands of the former Kraft Foods Inc.\r\n\r\nJob Number: 1714796\r\n\r\nDescription\r\n\r\nThe Commercial HRBP, acts as a partner by providing the different functions in the commercial unit outstanding HR expertise and delivery related to talent management, succession planning, organizational changes, organizational development and engagement.\r\nHe/she is the first point of contact for all HR related activities.','<ul>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Represent HR in local leadership team. Partners with the Country Leadership team and the Area HRD to deliver against functional HR goals, business goals and BU specific initiatives/projects in order to drive change programs in support of business strategies and initiatives.&nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Key contact for the local Commercial organization. Build good contextual business knowledge of the population, the operation and the business agenda.</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Responsible for providing HR guidance to all BU employees on topics such as talent management (including&nbsp; succession planning &amp; performance mgt), talent acquisition, compensation and benefits processes, training, employee relations and engagement activities.</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Works closely with the Talent &amp; Organizational Effectiveness CoE( Centre of Excellence ) to support the business in capability development and talent management activities capitalizing already existing tools, or developing new ones if needed</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Executes standard HR processes for the local Organization; supports people managers with guidance, workshops and coaching. Examples: performance management, compensation &amp; benefits, talent management and succession planning, employee relations, recruitment, L&amp;D, etc.</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Executes organizational changes, including consultations with legal and labor law specialists and local plant labor union (if needed). Prepares communication on the changes.&nbsp; Ensures proper documentation is in place.</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Ensure all labour laws are adhered to and verify compliance and HR policies and practices are administered in a consistent and professional manner.</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Deliver HR projects. Responsible for sharing best practices, local external benchmarking.</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">In this role you will have the benefit of working with a fast moving and international environment where you will get involved with interesting challenges on a daily basis.</li>\r\n</ul>','<ul style=\"list-style-type: none; list-style-position: initial; color: #000000; font-family: \'Open Sans\', arial, helvetica; background-color: #ffffff;\">\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Bachelor\'s Degree in Business Administration or similar discipline</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Experience: at least 6+ years of HR experience in different areas</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Interpersonal savvy: strong interpersonal and relationship building skills. Effective influencer, able to work cross-functionally and with contacts at all levels in the organization</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">People management &amp; coaching skills</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Customer focus</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Change agility</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Strong communication skills, able to spot and frame issues to enable effective cross-functional decision making</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Dealing with ambiguity</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Drive for results</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Ability to engage, inspire, and influence people</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Fluent in English</li>\r\n</ul>','Senior','Full time',2,'Nigeria','Lagos','<p>A life</p>',NULL,10,NULL,50,50,'NGN',2000000,NULL,2,1,'2018-03-28 13:04:58','2018-03-06',1,'Active',1,'2017-12-18 15:16:34','2018-03-28 13:04:58'),('Research Assistant - Agriculture, Food Security ..','The ONE Campaign is a global campaign and advocacy organization co-founded by Bono and backed by more than seven and half million people from around the world and every walk of life that are committed to the fight against extreme poverty and preventable disease, particularly in Africa.\r\n\r\nAbout the Opportunity\r\n\r\nWe are looking for an energetic, smart and motivated Research Assistant who believes in the power of research and evidence and wants to change the world with it. The Research Assistant will work with our Global policy team to support our policy-related activities. Specifically they will initially be responsible for supporting our work on Agriculture, Food security and Nutrition. The Assistant will work from our office, preferably in Abuja, and will report to the Policy Director.\r\nWe work in a collaborative and creative environment towards reaching a common goal of ending extreme poverty and preventable disease. When you work for ONE, you will receive an exceptional benefits package along with the opportunity to contribute to worldwide causes impacting those most in need.','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 13px; line-height: 22px; color: #000000; font-family: \'Open Sans\', arial, helvetica; background-color: #ffffff;\">In this role, you will:</p>\r\n<ul style=\"list-style-type: none; list-style-position: initial; color: #000000; font-family: \'Open Sans\', arial, helvetica; background-color: #ffffff;\">\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Collect, analyze, and edit reports on important policy issues on agriculture, food security and nutrition</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Prepare for and attend internal and external briefings and meetings, taking thorough notes and reporting back to the Policy Director</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Support the Policy Director in our work across several key agriculture and nutrition coalitions</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Monitor all global trends in on our issues to ensure that the team is kept informed of relevant updates.</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Update policy materials as needed</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Perform other tasks as assigned by the supervisor or designee.</li>\r\n</ul>','<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 13px; line-height: 22px; color: #000000; font-family: \'Open Sans\', arial, helvetica; background-color: #ffffff;\">What we need from you:</p>\r\n<p style=\"margin-top: 0px; margin-bottom: 0px; font-size: 13px; line-height: 22px; color: #000000; font-family: \'Open Sans\', arial, helvetica; background-color: #ffffff;\">&nbsp;</p>\r\n<div style=\"color: #000000; font-family: \'Open Sans\', arial, helvetica; background-color: #ffffff; clear: both;\">&nbsp;</div>\r\n<div class=\"btnLinks clearfix\" style=\"margin-top: 140px; color: #000000; font-family: \'Open Sans\', arial, helvetica; background-color: #ffffff;\">&nbsp;</div>\r\n<ul style=\"list-style: none; padding: 0px; color: #000000; font-family: \'Open Sans\', arial, helvetica; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial;\">\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">A Bachelor&rsquo;s in International Development, Economics, Politics, Social Science, Agriculture or the equivalent</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">1-2 years work experience in management consulting, a leading think-tank, academia, agriculture improvement programs, nutrition or any related field</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Excellent analytical, quantitative and problem solving skills. Experience of quantitative techniques and data science approaches is desirable.</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Excellent experience of MS Office tools (Word, Excel, PowerPoint)</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Demonstrable interest in development issues, and Africa</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Excellent organizational capacities</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Excellent written and verbal English communication skills; French is desirable</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Strong sense of teamwork and collaboration</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Ability to consistently apply good judgment and make good and responsible decisions</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">Ability to maintain the highest degree of confidentiality regarding all aspects of work at all times</li>\r\n<li style=\"list-style: outside; margin-left: 15px; font-size: 13px; margin-top: 10px;\">A can do attitude and a steadfast commitment to ONE&rsquo;s mission and values.</li>\r\n</ul>','Manager','Part time',1,'Nigeria','Ph','<p>A PhD</p>',NULL,15,NULL,50,50,'',8694680000,878569000,2,1,'2018-03-28 14:28:49','2018-02-15',1,'Deleted',2,'2017-12-18 17:38:38','2018-03-28 14:28:49'),('An Accounting role','This job is a job','<p>Here is a list</p>',NULL,'Entry','Entry',2,'Nigeria','Ikoyi','<p>You better have these</p>',NULL,5,NULL,50,50,NULL,NULL,NULL,NULL,1,'2017-12-19 16:02:48','2017-12-30',NULL,'Active',3,'2017-12-19 16:02:48','2018-01-05 01:47:10'),('Admin/Operations manager','An admin manager to oversee the maintenance, warehousing, IT and security operations of a leading modern grocery shop.','<ul>\r\n<li>Oversee the day-to-day operations of other support departments</li>\r\n<li>Monitoring and evaluation</li>\r\n<li>Administrative functions</li>\r\n</ul>','<ul>\r\n<li>A bachelor\'s degree in any relevant discipline</li>\r\n<li>Have experience working in a fast-paced environment</li>\r\n<li>Have HR experience</li>\r\n</ul>','Manager','Full time',33,'Nigeria','Lagos','<ul>\r\n<li>Excellent organisational skills</li>\r\n<li>Multitasking ability</li>\r\n<li>Preferably a female<u></u></li>\r\n</ul>',NULL,1,NULL,50,50,NULL,NULL,NULL,20,1,'2018-03-07 10:36:24','2018-03-30',6,'Deleted',11,'2018-02-08 14:08:09','2018-04-04 11:32:17'),('Brand marketing manager','Brand and marketing manager who has marketing responsibilities to develop and execute marketing programs that increase brand identity and brand awareness of a company or product.','<ol>\r\n<li>Plan, strategies and execute marketing designs and activities to establish and maintain brand presence in the market</li>\r\n<li>Define product strategies and road maps</li>\r\n<li>Research and determine product weaknesses and areas to be modified</li>\r\n<li>Develop sales tools and collateral\'s</li>\r\n<li>Develop effective product positioning in the market</li>\r\n<li>Conduct competitive strategic analysis, consumer segmentation, and consumer insight development</li>\r\n<li>Develop mid-term plan and financial analyses<u></u></li>\r\n</ol>\r\n<p>&nbsp;</p>','<ol>\r\n<li>At least 5 years experience as a brand manager</li>\r\n<li>Must have worke in a fashion outfit</li>\r\n<li>Strong marketing skills</li>\r\n</ol>','Manager','Full time',7,'Nigeria','Lagos','',NULL,53,NULL,50,50,NULL,NULL,NULL,20,1,'2018-03-07 10:36:41','2018-03-30',6,'Deleted',17,'2018-02-08 15:05:41','2018-04-17 12:20:14'),('Product Manager','Develops products by identifying potential products; conducting market research; generating product requirements; determining specifications, production timetables, pricing, and time-integrated plans for product introduction; developing marketing strategies.','<ul style=\"margin-bottom: 0px; margin-left: 0px; outline: 0px; padding-left: 24px; color: rgba(0, 0, 0, 0.87); font-family: Roboto, \'Helvetica Neue\', Helvetica, Arial, sans-serif; background-color: #ffffff;\">\r\n<li style=\"font-size: 0.875rem; line-height: 1.25rem; color: rgba(0, 0, 0, 0.87); outline: 0px; word-break: break-word;\">Launch products on a regular basis.</li>\r\n<li style=\"font-size: 0.875rem; line-height: 1.25rem; color: rgba(0, 0, 0, 0.87); outline: 0px; word-break: break-word;\">Identify market opportunities and define product vision and strategy.</li>\r\n<li style=\"font-size: 0.875rem; line-height: 1.25rem; color: rgba(0, 0, 0, 0.87); outline: 0px; word-break: break-word;\">Understand customer needs and gather product requirements.</li>\r\n<li style=\"font-size: 0.875rem; line-height: 1.25rem; color: rgba(0, 0, 0, 0.87); outline: 0px; word-break: break-word;\">Develop new products and enhance existing products.</li>\r\n<li style=\"font-size: 0.875rem; line-height: 1.25rem; color: rgba(0, 0, 0, 0.87); outline: 0px; word-break: break-word;\">Engage closely with the engineering team to help determine the best technical implementation methods as well as a reasonable implementation schedule.</li>\r\n</ul>','<ul style=\"margin-bottom: 0px; margin-left: 0px; outline: 0px; padding-left: 24px; color: rgba(0, 0, 0, 0.87); font-family: Roboto, \'Helvetica Neue\', Helvetica, Arial, sans-serif; background-color: #ffffff;\">\r\n<li style=\"font-size: 0.875rem; line-height: 1.25rem; color: rgba(0, 0, 0, 0.87); outline: 0px; word-break: break-word;\">Bachelor\'s degree in Computer Science or related technical field or equivalent.</li>\r\n<li style=\"font-size: 0.875rem; line-height: 1.25rem; color: rgba(0, 0, 0, 0.87); outline: 0px; word-break: break-word;\">4 years of related work experience.</li>\r\n<li style=\"font-size: 0.875rem; line-height: 1.25rem; color: rgba(0, 0, 0, 0.87); outline: 0px; word-break: break-word;\">Experience with product management or product design with a focus on software products and technologies.</li>\r\n<li style=\"font-size: 0.875rem; line-height: 1.25rem; color: rgba(0, 0, 0, 0.87); outline: 0px; word-break: break-word;\">Experience developing Internet products and technologies.</li>\r\n</ul>','Senior','Full time',23,'Nigeria','Lagos','<ul style=\"margin-bottom: 0px; margin-left: 0px; outline: 0px; padding-left: 24px; color: rgba(0, 0, 0, 0.87); font-family: Roboto, \'Helvetica Neue\', Helvetica, Arial, sans-serif; background-color: #ffffff;\">\r\n<li style=\"font-size: 0.875rem; line-height: 1.25rem; color: rgba(0, 0, 0, 0.87); outline: 0px; word-break: break-word;\">Knowledge of multiple functional areas such as Product Management, Engineering, UX/UI, Sales, Customer Support, Finance or Marketing.</li>\r\n<li style=\"font-size: 0.875rem; line-height: 1.25rem; color: rgba(0, 0, 0, 0.87); outline: 0px; word-break: break-word;\">Excellent problem-solving, organizational and analytical skills.</li>\r\n</ul>',NULL,4,NULL,50,50,NULL,NULL,NULL,22,1,'2018-02-28 12:51:26','2018-03-02',8,'Active',20,'2018-02-28 12:47:31','2018-02-28 22:54:09'),('Business Development','We are seeking a Business Development Executive  that will lead and support a range of responsibilities mainly focused in the areas of:\r\n\r\n-   Industry Analysis\r\n\r\n-   Marketing and Strategic Planning\r\n\r\n-   Strategy\r\n\r\nThis is an ideal opportunity to join a business that has been demonstrating significant growth for a period of time, offering potential candidates a challenging, autonomous and exciting environment to develop their career.','<p style=\"word-wrap: break-word; color: #737373; font-family: proxima-nova; font-size: 18px; font-style: normal; font-variant-caps: normal; font-weight: 300; letter-spacing: 0.27000001072883606px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px;\">-Develop a comprehensive understanding of the products and services offered and conduct sales calls and make product / service presentations to meet customer needs.</p>\r\n<p style=\"word-wrap: break-word; color: #737373; font-family: proxima-nova; font-size: 18px; font-style: normal; font-variant-caps: normal; font-weight: 300; letter-spacing: 0.27000001072883606px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px;\">-Identify business opportunities and ensure our company receives enquires (RFQs) from clients and customers.</p>\r\n<p style=\"word-wrap: break-word; color: #737373; font-family: proxima-nova; font-size: 18px; font-style: normal; font-variant-caps: normal; font-weight: 300; letter-spacing: 0.27000001072883606px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px;\">-Assist with the management of procurement related issues.</p>\r\n<p style=\"word-wrap: break-word; color: #737373; font-family: proxima-nova; font-size: 18px; font-style: normal; font-variant-caps: normal; font-weight: 300; letter-spacing: 0.27000001072883606px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px;\">-Track new business development opportunities, utilizing market knowledge and market intelligence tools to identify projects which are aligned to the company&rsquo;s growth strategy.</p>\r\n<p style=\"word-wrap: break-word; color: #737373; font-family: proxima-nova; font-size: 18px; font-style: normal; font-variant-caps: normal; font-weight: 300; letter-spacing: 0.27000001072883606px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px;\">-Develop strong relationships with key clients and potential clients operating within the oil and gas industry and promote the services of the Company.</p>\r\n<p style=\"word-wrap: break-word; color: #737373; font-family: proxima-nova; font-size: 18px; font-style: normal; font-variant-caps: normal; font-weight: 300; letter-spacing: 0.27000001072883606px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px;\">-Remain current on sales performance and provide sales reports by providing periodic status reports detailing activity and efforts, as well as win/loss analysis.</p>\r\n<p style=\"word-wrap: break-word; color: #737373; font-family: proxima-nova; font-size: 18px; font-style: normal; font-variant-caps: normal; font-weight: 300; letter-spacing: 0.27000001072883606px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px;\">-Look for opportunities to build technical strategic relationships with key organisations.</p>','<p style=\"word-wrap: break-word; color: #737373; font-family: proxima-nova; font-size: 18px; font-style: normal; font-variant-caps: normal; font-weight: 300; letter-spacing: 0.27000001072883606px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px;\">-Bachelor Degree with emphasis in business or engineering preferred.</p>\r\n<p style=\"word-wrap: break-word; color: #737373; 