ervice strategy for delivering revenue at the regional level. ','<ul>\r\n<li>Define and drive Commercial strategy for the South Region\r\n<ul>\r\n<li>Drive the implementation of commercial strategy to ensure suerior visibility and customer intimacy of the brand compared to competition, in conjuction with the Regional Oerations Director, Central Brands team, Regional Commercial team&nbsp;</li>\r\n<li>Develop and lead the Regional Commercial activities and policies&nbsp;</li>\r\n<li>Review market research to determine opportunities that exist and ways to capitalize on them&nbsp;</li>\r\n</ul>\r\n</li>\r\n<li>Drive Customer Acquisition&nbsp;\r\n<ul>\r\n<li>Drive acquisition strategies for the various sales verticals across Retail and Corporate businesses which will ensure an increase in share of customers&nbsp;</li>\r\n<li>Prevent churn of existing customer base - Actively manage churn to less than 3% and deliver customer retention programes that will ensure increase in customer net additions</li>\r\n</ul>\r\n</li>\r\n<li>Regional Trade and Activations<br />\r\n<ul>\r\n<li>Driving the Regional trade marketing strategy and implementation plans to drive effective brand communication at the point of sale in key retail trade channels as well as company owned assets.\r\n<ul>\r\n<li>Product and services communication</li>\r\n<li>Campaign and promotions communications</li>\r\n<li>In-store brand communications for Airtel stores&nbsp;</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n<li>Customer Experience Enhancement and Reduction in Customer Complaints&nbsp;\r\n<ul>\r\n<li>Analyze, recommend and enable changes in Acquisition policies and procedures with the Regional Director&nbsp;</li>\r\n<li>Insitute the process and evaluation of monitoring health of acquisitions&nbsp;</li>\r\n<li>Plan and implement a robust complaint management system that ensures timely resolution &nbsp;of queries&nbsp;</li>\r\n<li>Analyze customer complaints process wise and design action plans for process improvement, and influence the respective process owner for change.&nbsp;</li>\r\n<li>Work with Head Office and other cross-functional teams for process changes and other initiatives for enhancing customer experience in the zone</li>\r\n<li>Control bad debts&nbsp;</li>\r\n</ul>\r\n</li>\r\n<li>Ensure optimal spend vis-a-vis budget and monitoring performance&nbsp;</li>\r\n<li>Development of an effective team through coaching, mentoring and guidiance</li>\r\n</ul>','<ul>\r\n<li>Bachelor\'s degree in Marketing and Managemenrt or like discipline&nbsp;</li>\r\n<li>At least 15 years working experience with 7 years or more in Senior Management role in FMCG industry and at least 5 years in Telecoms Marketing&nbsp;</li>\r\n<li>Strong people skills - Building collaborative relationships and empowerig and developing people&nbsp;</li>\r\n<li>Business and commercial acumen&nbsp;</li>\r\n<li>Excellent understanding of coporate governance standards</li>\r\n</ul>\r\n<p>&nbsp;</p>','Senior','Full time',30,'Nigeria','PHC, Rivers State','<ul style=\"background-color: #ffffff; color: #626262;\">\r\n<li>An MBA with focus on Marketing&nbsp;</li>\r\n<li>Analytical skills&nbsp;</li>\r\n</ul>',NULL,7,NULL,50,50,'',0,0,45,1,'2018-03-28 13:10:15','2018-03-16',12,'Active',29,'2018-03-12 11:21:22','2018-03-28 13:10:15'),('Facilities Cordinator','To provide administrate support and supervision at the Facility \r\nTo coordinate the all facility management operations from the creation of Job order and the satisfactory completion of the job.  \r\nTo collate and update all equipment operational data and preparation of day to day reports.','<p>&bull; Receive daily incoming work orders and ensure proper distribution internally and externally.</p>\r\n<p>&bull; Distribute work orders to ensure all work orders are actioned according to their level of response as defined by SLA&rsquo;s and KPI&rsquo;s.</p>\r\n<p>&bull; Receive and issue deliveries for the office.</p>\r\n<p>&bull; Maintain the ETCOFM site office in line with company guidelines and the instructions of the Facility Manager.</p>\r\n<p>&bull; Prepare reports and compile data as required by the Facility Manager.</p>\r\n<p>&bull; Instruct the technical staff and contractors on the work requirement to complete maintenance activities.</p>\r\n<p>&bull; Inspect the work for quality of material used and service delivery within agreed SLA.</p>\r\n<p>&bull; Track all job orders until timely completion and update records accordingly.</p>\r\n<p>&bull; Ensure that daily report of site operation prepared and sent to Facility Manager on time&nbsp;</p>\r\n<p>&bull; Ensure that company HSE policies are followed.</p>\r\n<p>&bull; Manage HSE tool box meetings as per schedule.</p>\r\n<p>&bull; Assist the Facility Manager with the organisation and preparation of monthly and other MIS reporting functions.</p>\r\n<p>&bull; Maintain all documentation in line with company policy and filing requirements.</p>\r\n<p>&bull; Meet with customers and assist with the resolution of client complaints.</p>\r\n<p>&bull; Be a key support staff member as required for the Facility Management Team.</p>','<ul>\r\n<li class=\"MsoNormal\" style=\"text-indent: -17.5pt; line-height: normal; mso-list: l0 level1 lfo1; margin: 0in 0in 2.35pt 40.05pt;\"><span style=\"font-size: 10.5pt; mso-bidi-font-size: 11.0pt; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\"><span style=\"mso-list: Ignore;\"><span style=\"font: 7.0pt \'Times New Roman\';\"><span style=\"font-family: Arial, sans-serif;\">&nbsp;</span></span><span style=\"font: 7.0pt \'Times New Roman\';\"> &nbsp; &nbsp; &nbsp;</span></span></span><!--[endif]--><span style=\"font-size: 10.5pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">A diploma or degree in engineering or equivalent</span></li>\r\n<li class=\"MsoNormal\" style=\"text-indent: -17.5pt; line-height: normal; mso-list: l0 level1 lfo1; margin: 0in 0in 2.35pt 40.05pt;\"><span style=\"font-size: 10.5pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">&nbsp; &nbsp; &nbsp;C</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 10.5pt; text-indent: -17.5pt;\">omputer literate and proficient in Microsoft Office suite of programs&nbsp;&nbsp;</span></li>\r\n</ul>','Associate','Full time',10,'Nigeria','Apapa,Lagos','<p class=\"MsoNormal\" style=\"margin: 0in 0in 2.3pt 40.05pt; background-color: #ffffff; color: #626262; text-indent: -17.5pt; line-height: 15.54px;\"><span style=\"font-size: 10.5pt; line-height: 15.54px; font-family: Arial, sans-serif;\">&bull;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp; &nbsp; &nbsp;&nbsp;</span></span><span style=\"font-size: 10.5pt; mso-bidi-font-size: 11.0pt; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\"><span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;</span></span><span style=\"font-size: 10.5pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Excellent standard of written and spoken English.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -17.5pt; line-height: normal; mso-list: l0 level1 lfo1; margin: 0in 0in 2.1pt 40.05pt;\"><span style=\"font-size: 10.5pt; mso-bidi-font-size: 11.0pt; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\">&bull;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 10.5pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Advanced customer service experience and a Team Player.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 2.3pt 40.05pt; background-color: #ffffff; color: #626262; text-indent: -17.5pt; line-height: 15.54px;\"><span style=\"font-size: 10.5pt; line-height: 15.54px; font-family: \'Times New Roman\', serif;\"><span style=\"font-size: 10.5pt; mso-bidi-font-size: 11.0pt; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\">&bull;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 10.5pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Superior organizational ability.</span>Works well under pressure and has time management skills to ensure that deadlines and targets are met.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 2.35pt 40.05pt; background-color: #ffffff; color: #626262; text-indent: -17.5pt; line-height: normal;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">&bull;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 10.5pt; font-family: \'Times New Roman\', serif;\">Excellent communicator.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 2.3pt 40.05pt; background-color: #ffffff; color: #626262; text-indent: -17.5pt; line-height: normal;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">&bull;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 10.5pt; font-family: \'Times New Roman\', serif;\">Flexible and motivated member of the team.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 2.55pt 40.05pt; background-color: #ffffff; color: #626262; text-indent: -17.5pt; line-height: normal;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">&bull;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 10.5pt; font-family: \'Times New Roman\', serif;\">Analytical thinking.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 2.35pt 40.05pt; background-color: #ffffff; color: #626262; text-indent: -17.5pt; line-height: normal;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">&bull;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 10.5pt; font-family: \'Times New Roman\', serif;\">Cultural understanding.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 2.3pt 40.05pt; background-color: #ffffff; color: #626262; text-indent: -17.5pt; line-height: 15.54px;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 1.65pt 40.05pt; background-color: #ffffff; color: #626262; text-indent: -17.5pt; line-height: normal;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">&bull;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 10.5pt; font-family: \'Times New Roman\', serif;\">Motivated and dynamic.</span></p>',NULL,29,NULL,50,50,'NGN',70000,100000,20,1,'2018-03-14 07:59:38','2018-04-09',6,'Deleted',31,'2018-03-13 09:13:53','2018-04-14 16:53:27'),('Facilities Manager','Leading a Facility Management (FM) team to deliver a quality FM service to our clients. The services will be in the majority minor works, reactive jobs and planned maintenance tasks.\r\n\r\nYou will be focused on delivering this service through the maximum utilization of available resources under your direction. This will include being aligned with the contract service level agreement and key performance indicators for the services provided to our clients. It is a client facing position and requires experience in the challenging FM environment where the delivery of premium services is a prerequisite to client satisfaction. ','<p>&bull; Establish relationships with our suppliers to ensure the quality of work meets industry best practice.&nbsp;</p>\r\n<p>&bull; Supervise the operation of the suppliers and staff to ensure that all works are carried out in a professional and timely manner.&nbsp;</p>\r\n<p>&bull; Ensure that each team executes their work to meet industry best practice.&nbsp;</p>\r\n<p>&bull; Supervise the co-ordination between our customers and your team members to ensure satisfactory completion of all jobs.&nbsp;</p>\r\n<p>&bull; Oversee the general status of your designated area to ensure safe and secure conditions&nbsp;</p>\r\n<p>&bull; Manage the facilities under your responsibility and represent the company in front of clients, customers and local authorities.&nbsp;</p>\r\n<p>&bull; Ensure safe, secure, and hygienic standards are maintained by the staff and suppliers at all times.&nbsp;</p>\r\n<p>&bull; Organize daily weekly and monthly meetings with the suppliers or your team to ensure that all PPM, reactive maintenance, minor works and helpdesk activities are carried out.&nbsp;</p>\r\n<p>&bull; Establish methods of working practice for each task and ensure that all members of the team understand their responsibilities&nbsp;</p>\r\n<p>&bull; Ensure that all of your allocated work is performed to optimize productivity and quality of service.&nbsp;</p>\r\n<p>&bull; Ensure that your team is fully conversant with the company operating procedures especially HSE.&nbsp;</p>\r\n<p>&bull; Carry out routine inspection of works to ensure that the quality of workmanship meets the service level agreements and excels key performance indicators&nbsp;</p>\r\n<p>&bull; Produce daily proactive/housekeeping routines that will support the reduction of helpdesk calls.&nbsp;</p>\r\n<p>&bull; Establish a strong relationship with the client representatives within your assigned property.&nbsp;</p>\r\n<p>&bull; Ensure that communication between your team and our customers is timely and professional.&nbsp;</p>\r\n<p>&bull; Implement/Manage customer audits to gain feedback on the level of service</p>','<ul>\r\n<li class=\"MsoNormal\" style=\"text-indent: 0in; line-height: normal; mso-list: l0 level1 lfo1; margin: 0in 0in 1.15pt 22.55pt;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\">A degree qualification in an engineering related field is the preferred qualification.</span><span style=\"text-indent: 0in; font-size: 10pt; line-height: 106%; font-family: Arial, sans-serif;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;</span></span></li>\r\n<li class=\"MsoNormal\" style=\"text-indent: 0in; line-height: normal; mso-list: l0 level1 lfo1; margin: 0in 0in 1.15pt 22.55pt;\"><span style=\"text-indent: 0in; font-size: 10pt; line-height: 106%; font-family: Arial, sans-serif;\">Minimum of 6 to 8 years post graduation experience with a strong background in Facility Management. </span></li>\r\n</ul>','Senior','Full time',10,'Nigeria','Apapa,Lagos','<ul>\r\n<li class=\"MsoNormal\" style=\"text-indent: 0in; line-height: normal; mso-list: l0 level1 lfo1; margin: 0in 0in 1.15pt 22.55pt;\"><span style=\"text-indent: 0in; font-size: 10pt; line-height: 106%; font-family: Arial, sans-serif;\">In-depth experience of leading a maintenance team to achieve a planned maintenance program in addition to provision of minor and reactive works is also essential</span></li>\r\n<li class=\"MsoNormal\" style=\"text-indent: 0in; line-height: 106%; mso-list: l0 level1 lfo1; margin: 0in 0in 1.35pt 22.55pt;\"><span style=\"font-family: Arial, sans-serif; font-size: 10pt;\">Computer literate and proficient in Microsoft Office suite of programs</span></li>\r\n<li class=\"MsoNormal\" style=\"text-indent: 0in; line-height: 106%; mso-list: l0 level1 lfo1; margin: 0in 0in 1.35pt 22.55pt;\"><span style=\"text-indent: 0in; font-size: 10pt; font-family: Arial, sans-serif;\">Well refined MIS reporting knowledge</span></li>\r\n<li class=\"MsoNormal\" style=\"text-indent: 0in; line-height: 106%; mso-list: l0 level1 lfo1; margin: 0in 0in 1.35pt 22.55pt;\"><span style=\"text-indent: 0in; font-size: 10pt; font-family: Arial, sans-serif;\">Ability to communicate at all levels of the supply chain from sub-contractors, to clients and peers</span></li>\r\n<li class=\"MsoNormal\" style=\"text-indent: 0in; line-height: 106%; mso-list: l0 level1 lfo1; margin: 0in 0in 1.35pt 22.55pt;\"><span style=\"text-indent: 0in; font-size: 10pt; font-family: Arial, sans-serif;\">A Team Leader with front line customer service experience and excellent communication skills</span></li>\r\n<li class=\"MsoNormal\" style=\"text-indent: 0in; line-height: normal; mso-list: l0 level1 lfo1; margin: 0in 0in 1.6pt 22.55pt;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\">Very good standard of written and spoken English</span></li>\r\n<li class=\"MsoNormal\" style=\"text-indent: 0in; line-height: normal; mso-list: l0 level1 lfo1; margin: 0in 0in 1.6pt 22.55pt;\"><span style=\"text-indent: 0in; font-size: 10pt; line-height: 112%; font-family: Arial, sans-serif;\">Flexible and motivated as a member and leader of the FM team</span></li>\r\n<li class=\"MsoNormal\" style=\"text-indent: 0in; line-height: 112%; mso-list: l0 level1 lfo1; margin: 0in 0in 1.55pt 22.55pt;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 112%; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\">Utilises analytical thinking &amp; problem solver.</span></li>\r\n<li class=\"MsoNormal\" style=\"text-indent: 0in; line-height: 112%; mso-list: l0 level1 lfo1; margin: 0in 0in 1.55pt 22.55pt;\"><span style=\"text-indent: 0in; font-size: 10pt; font-family: Arial, sans-serif;\">Flexible and self-motivated.</span></li>\r\n<li class=\"MsoNormal\" style=\"text-indent: 0in; line-height: 112%; mso-list: l0 level1 lfo1; margin: 0in 0in 1.55pt 22.55pt;\"><span style=\"text-indent: 0in; font-size: 10pt; font-family: Arial, sans-serif;\">Cultural understanding</span></li>\r\n<li class=\"MsoNormal\" style=\"text-indent: 0in; line-height: 112%; mso-list: l0 level1 lfo1; margin: 0in 0in 1.55pt 22.55pt;\"><span style=\"text-indent: 0in; font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;\">Motivated and dynamic</span></li>\r\n</ul>',NULL,33,NULL,50,50,'NGN',120000,250000,20,1,'2018-03-14 07:59:52','2018-04-09',6,'Deleted',32,'2018-03-13 09:32:13','2018-04-18 16:47:24'),('HSE/QA-QC Manager ','To lead the HSE/QA-QC department advising the Facility Management (FM) team on Health, Safety and Environmental issue and also the QA/QC.\r\n\r\nTo deliver a quality FM service to our clients.\r\n\r\nResponsible for coordination of the overall activities of the company to meet quality, health and safety standards.\r\n\r\nMonitors advice on performance issues related to Quality Management Systems and Health and Safety.','<p>&bull; Promote quality achievement and performance improvement throughout the company;&nbsp;</p>\r\n<p>&bull; Serve as the primary quality control and safety source for problem identification, resolution, loss reporting and continuous improvement&nbsp;</p>\r\n<p>&bull; Develop and implement quality management strategy and plans to support, contribute to and integrate within the company&rsquo;s business plan and long term strategy;&nbsp;&nbsp;</p>\r\n<p>&bull; Design, develop and ensure full implementation of quality control and safety systems;&nbsp;</p>\r\n<p>&bull; Design, implement and document procedures for process control, process improvement, testing and inspection;&nbsp;</p>\r\n<p>&bull; Establish and implement metrics (process capability, control charts, measurement quality) for monitoring system effectiveness and to enable managers to make sound product quality decisions;&nbsp;</p>\r\n<p>&bull; Submit reports on quality and safety violations and performs root-cause analysis and other problem solving activities to identify effective corrective actions and process improvements;&nbsp;&nbsp;</p>\r\n<p>&bull; Ensure the application of all related processes, policies and procedures prior to commencement of company`s projects and respected throughout the full life cycle of the projects;&nbsp;&nbsp;</p>\r\n<p>&bull; Ensure compliance with national and international standards and legislation;&nbsp;</p>\r\n<p>&bull; Establish and implement necessary communications strategy for the improvement and awareness of quality and safety issues across all departments;&nbsp;</p>\r\n<p>&bull; Prepare and manage department budget in line with the company`s objective and in full coordination with the management;&nbsp;&nbsp;</p>\r\n<p>&bull; Approve the annual safety and security plan and goals, identifies projects, sets budgets and manages expenditures;&nbsp;</p>\r\n<p>&bull; Monitor the implementation of the safety and security plan, supporting the Company&rsquo;s goals and objectives;&nbsp;</p>\r\n<p>&bull; Perform systematic and periodical reviews and reports to management on quality and safety issues, trends and losses;&nbsp;</p>\r\n<p>&bull; Perform periodical visits to different locations to ensure full implementation of quality and safety standards.&nbsp;</p>\r\n<p>&bull; Manage and monitor quality control and safety personnel on day-to-day basis;&nbsp;</p>\r\n<p>&bull; Provide on-going training and communication to quality and safety personnel located in different business units within the company.&nbsp;</p>\r\n<p>&bull; Monitor and approve investigation reports regarding theft, alarms, accidents, injuries and other incidents that may occur</p>\r\n<ul>\r\n<li>Liaise with other managers and staff throughout the company to ensure that quality and safety systems are functioning in line with the set policies.&nbsp;</li>\r\n</ul>','<ul>\r\n<li><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\"><span style=\"mso-list: Ignore;\"><span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp; &nbsp;&nbsp;</span></span></span><!--[endif]--><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\">A degree or equivalent with additional professional qualification in HSE and QA/QC;<span style=\"mso-spacerun: yes;\">&nbsp;</span></span></li>\r\n<li>10+ years of experience in QA/QC systems implementation and management of HSE and quality in the facilities management company;</li>\r\n</ul>','Senior','Full time',10,'Nigeria','Apapa,Lagos','<ul>\r\n<li><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 95%; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;</span></span><!--[endif]--><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\">Have effective verbal and written communication skills in English, listening skills, ability to organise and retrieve information and to handle people tactfully and effectively in situations involving various educational and employment levels; </span></li>\r\n<li><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;</span></span><!--[endif]--><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\">Must be flexible to adapt changing and varying work requirements;</span></li>\r\n<li><span style=\"font-size: 11pt; line-height: 115%; font-family: Arial, sans-serif; color: black;\">Excellent problem solving capabilities and ability to work independently on assigned tasks; </span></li>\r\n<li><span style=\"font-size: 11pt; line-height: 115%; font-family: Arial, sans-serif; color: black;\">Open-minded with good written and oral communication;&nbsp;</span></li>\r\n</ul>',NULL,0,NULL,50,50,'NGN',100000,120000,20,1,'2018-03-14 08:00:10','2018-04-09',6,'Deleted',33,'2018-03-13 10:14:10','2018-04-10 08:19:49'),('Stores/Procurement Manager                      ','Leading the Stores/Procurement department to manage the procurement process effectively, by following agreed QA-QC procedure in a cost effective approach. Also to manage the stores without any complaint from the user which will benefit the overall growth of the company operations. ','<p><span style=\"color: #000000; font-family: \'Times New Roman\', serif;\">&bull; Devise and use fruitful sourcing strategies&nbsp;</span></p>\r\n<p><span style=\"color: #000000; font-family: \'Times New Roman\', serif;\">&bull; Discover profitable suppliers and initiate business and organization partnerships&nbsp;</span></p>\r\n<p><span style=\"color: #000000; font-family: \'Times New Roman\', serif;\">&bull; Negotiate with external vendors to secure advantageous terms&nbsp;</span></p>\r\n<p><span style=\"color: #000000; font-family: \'Times New Roman\', serif;\">&bull; Finalize purchase details of orders and deliveries&nbsp;</span></p>\r\n<p><span style=\"