stomers assets.&nbsp;</span></p>\r\n<p><span style=\"color: #000000; font-family: \'Times New Roman\', serif;\">&bull; Maintain up-to-date information concerning the Record details of complaints and actions taken.&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #000000; font-family: \'Times New Roman\', serif;\">&bull; Communicate and coordinate with internal departments.&nbsp;</span></p>\r\n<p>&nbsp;</p>','<ul>\r\n<li><span style=\"font-size: 11.5pt; mso-bidi-font-size: 11.0pt; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\"><span style=\"mso-list: Ignore;\"><span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;</span></span></span><!--[endif]--><span style=\"font-size: 10.5pt; mso-bidi-font-size: 11.0pt; font-family: \'Segoe UI\',\'sans-serif\'; mso-fareast-font-family: \'Segoe UI\';\">B.Sc. degree in Business Administration or relevant field</span></li>\r\n<li><span style=\"font-size: 10.5pt; mso-bidi-font-size: 11.0pt; line-height: 130%; font-family: \'Segoe UI\',\'sans-serif\'; mso-fareast-font-family: \'Segoe UI\';\">Proven successful experience of minimum 5years as a Stores/Procurement manager in a Facility Management Company </span></li>\r\n</ul>','Senior','Full time',10,'Nigeria','Apapa,Lagos','<ul>\r\n<li><span style=\"font-size: 11.5pt; mso-bidi-font-size: 11.0pt; line-height: 128%; font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: Arial;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp; &nbsp; &nbsp;&nbsp;</span></span><!--[endif]--><span style=\"font-size: 10.5pt; mso-bidi-font-size: 11.0pt; line-height: 128%; font-family: \'Segoe UI\',\'sans-serif\'; mso-fareast-font-family: \'Segoe UI\';\">Knowledge of sourcing and procurement techniques as well as a dexterity in &ldquo;reading&rdquo; the market</span></li>\r\n<li><span style=\"font-variant-numeric: normal; font-va