o FDOA by ensuring that products are apporved in line with FDOA and violations escalated for prompt resolution</li>\r\n<li>Monthly update of Commercial reports</li>\r\n<li>OPEX reporting&nbsp;</li>\r\n<li>Review and analyze contracts with the objectives of flagging potential financial risks and implications</li>\r\n<li>Other Adhoc reports as required</li>\r\n</ul>\r\n</li>\r\n</ul>','<ul>\r\n<li>BSc in Accounting or Economics or any other related field</li>\r\n<li>Professional qualification in Accounting&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>','Associate','Full time',30,'Nigeria','Lagos','<ul>\r\n<li>Negotiation Skills&nbsp;</li>\r\n<li>Analytical skills&nbsp;</li>\r\n<li>Communication skills</li>\r\n<li>Orgainzational awareness&nbsp;</li>\r\n<li>Above average proficiency in Microsoft Office&nbsp;</li>\r\n<li>Data analysis&nbsp;</li>\r\n<li>Reporting skills&nbsp;</li>\r\n<li>Pricing knowlege</li>\r\n</ul>\r\n<p>&nbsp;</p>',NULL,101,NULL,50,50,'NGN',5319440,8800000,45,1,'2018-03-28 14:29:46','2018-04-11',12,'Active',36,'2018-03-20 08:52:58','2018-04-13 21:19:35'),('for bulk','testing job','<p>Nothing</p>','','Entry','Full time',2,'Nigeria','Lagos','',NULL,0,NULL,50,50,'',0,0,2,1,'2018-03-28 14:35:54','2018-03-06',1,'Active',41,'2018-03-28 14:35:54','2018-03-28 14:35:54'),('TEST JOB.  Do not Apply','Administrative Assistant','<ul>\r\n<li style=\"box-sizing: inherit; outline: 0px; color: #555555; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 18px; background-color: #ffffff;\">Handle administrative requests and queries from senior managers</li>\r\n<li style=\"box-sizing: inherit; outline: 0px; color: #555555; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 18px; background-color: #ffffff;\">Organizing and scheduling appointments with admin software</li>\r\n<li style=\"box-sizing: inherit; outline: 0px; color: #555555; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 18px; background-color: #ffffff;\">Planning