,50,'USD',40000,40000,39,1,'2018-04-17 10:23:44','2018-04-10',9,'Active',44,'2018-04-09 10:16:58','2018-04-17 10:23:44'),('Senior Back-End Developer (Team Lead)','An experienced Senior Back-End Developer that is passionate about user experience to join our Lagos team.The Back-End Developer should be familiar with Elixir and Ruby or similar languages. ','<ul>\r\n<li class=\"MsoNormal\" style=\"margin-left: 17.25pt; text-indent: 0in;\">Support​ ​and​ ​maintain​ ​existing​ ​production​ ​code​ ​in​ ​the​ ​field​ ​and​ ​develop​ ​and deliver​ ​new​ ​enhancements​ ​and​ ​products​ ​to​ ​our​ ​client​ ​base.</li>\r\n<li class=\"MsoNormal\" style=\"margin-left: 17.25pt; text-indent: 0in;\">Collaborate​ ​with​ ​product​ ​management,​ ​operations,​ ​quality​ ​and​ ​front-end engineers​ ​to​ ​deliver​ ​the​ ​right​ ​solution.</li>\r\n<li class=\"MsoNormal\" style=\"margin-left: 17.25pt; text-indent: 0in;\">Develop​ ​reliable,​ ​high​ ​performance​ ​service​ ​applications​ ​using​ ​Elixir​ ​and​ ​Phoenix</li>\r\n<li class=\"MsoNormal\" style=\"margin-left: 17.25pt; text-indent: 0in;\">Provide,​ ​configure,​ ​and​ ​develop​ ​against​ ​remote​ ​infrastructure​ ​in​ ​AWS<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: 17.25pt; text-indent: 0in;\"><span style=\"text-indent: -0.25in;\">Integration​ ​of​ ​user-facing​ ​elements​ ​developed​ ​by​ ​a​ ​front-end​ ​developer​ ​with​ ​our API</span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: 17.25pt; text-indent: 0in;\"><span style=\"text-indent: -0.25in;\">Build​ ​reusable​ ​code​ ​and​ ​libraries​ ​for​ ​future​ ​use</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: 17.25pt; text-indent: 0in;\"><span style=\"text-indent: -0.25in;\">Optimisation​ ​of​ ​the​ ​application​ ​for​ ​maximum​ ​speed​ ​and​ ​scalability</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: 17.25pt; text-indent: 0in;\"><span style=\"text-indent: -0.25in;\"><span style=\"text-indent: -0.25in;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;</span><span style=\"text-indent: -0.25in;\">Separation​ ​of​ ​centralised​ ​services​ ​into​ ​micro​ ​services</span></span></span>\r\n<p class=\"MsoNormal\" style=\"margin-left: 35.25pt; text-indent: -.25in; mso-list: l0 level1 lfo1;\">&nbsp;</p>\r\n</li>\r\n</ul>','<ul>\r\n<li class=\"MsoNormal\" style=\"margin-left: 17.25pt; text-indent: 0in;\">Experience​ ​with​ ​Amazon​ ​Web​ ​Services​ ​(AWS)</li>\r\n<li class=\"MsoNormal\" style=\"margin-left: 17.25pt; text-indent: 0in;\">2+​ ​years​ ​professional​ ​experience​ ​with​ ​Elixir/Ruby​ ​on​ ​Rails​ ​or​ ​similar​ ​languages</li>\r\n<li class=\"MsoNormal\" style=\"margin-left: 17.25pt; text-indent: 0in;\"><span style=\"text-indent: 0in;\">Experience​ ​with​ ​Git,​ ​Jenkins,​ ​Docker,​ ​Ansible/Chef/Puppet​ ​or​ ​similar​ ​tools</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: 17.25pt; text-indent: 0in;\"><span style=\"text-indent: -0.25in;\">Experience​ ​with​ ​relational​ ​databases​ ​(PostGreSQL,​ ​MySQL)​ ​and​ ​key-value​ ​stores (Memcache,​ ​Redis)</span></li>\r\n</ul>','Senior','Full time',15,'Nigeria','Lekki, Lagos','<ul>\r\n<li><span style=\"background-color: #ffffff; color: #626262; text-indent: -0.25in;\">Pride​ ​in​ ​readable,​ ​well-designed,​ ​well-tested​ ​software</span><span style=\"background-color: #ffffff; color: #626262; text-indent: -0.25in; font-size: 10pt; line-height: 13.3333px; font-family: Arial, sans-serif;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;</span></span></li>\r\n<li><span style=\"text-indent: -0.25in;\">Good​ ​oral​ ​and​ ​written​ ​communication​ ​skills</span></li>\r\n</ul>\r\n<p class=\"MsoNormal\" style=\"margin-left: 17.25pt; background-color: #ffffff; color: #626262; text-indent: 0in;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 35.25pt; text-indent: -0.25in;\">&nbsp;</p>\r\n<p>&nbsp;</p>',NULL,11,NULL,50,50,'NGN',0,500000,1,1,'2018-04-11 08:34:38','2018-04-30',6,'Active',45,'2018-04-11 08:34:38','2018-04-19 16:27:15'),('Restaurant Manager','An experienced restaurant manager with a knack for sales and PR related activities ','<ul>\r\n<li>Build up sales and improve relations with customers</li>\r\n<li>Manage and control stores</li>\r\n<li>Ability to manage inventory including cash</li>\r\n<li>Develop new business/strategies for the restaurant</li>\r\n<li>Boost the restaurant\'s clientelle/customers base and its social media presence</li>\r\n<li>Create, plan and manage the restaurant\'s events</li>\r\n</ul>\r\n<p>&nbsp;</p>','<ul>\r\n<li>Must be between 28-25 years of age</li>\r\n<li>Must be single</li>\r\n<li>At least&nbsp; 2-3 years cognate experience</li>\r\n</ul>','Senior','Full time',1,'Nigeria','Lagos','<ul>\r\n<li>Must be well organised</li>\r\n<li>Proven track record of managing people</li>\r\n<li>Must have an expansive network of people</li>\r\n<li>Must be creative and proactive</li>\r\n</ul>',NULL,12,NULL,50,50,'NGN',350000,360000,20,1,'2018-04-11 08:51:48','2018-04-30',6,'Active',46,'2018-04-11 08:51:48','2018-04-19 16:26:52'),('Solar Solutions Architect','The Solar Solutions Architect will be generally responsible for ensuring technical and commercial support to sales and opportunity leaders. He/she will also manage consolidated opportunity portfolio, ensure bid invest decision, risk assessment before submitting the offers, commercial & technical impact evaluation during negotiations, closing the contract and transfer to Project/Site manager.\r\n\r\nHe/she will be responsible for the following:\r\n1.	Customer Satisfaction\r\n2.	Number and Quality of the bids prepared\r\n3.	Number of bids won\r\n4.	Hit Rate','<ul>\r\n<li class=\"MsoNormal\" style=\"margin-left: .25in; line-height: 150%;\"><span lang=\"EN-GB\" style=\"font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-fareast-language: EN-GB;\">From the project brief, understands the customer objectives and define the strategy to win the deal.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: .25in; line-height: 150%;\"><span lang=\"EN-GB\" style=\"font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-fareast-language: EN-GB;\">If necessary, conduct site survey, energy audits and analyse the customer needs.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: .25in; line-height: 150%;\"><span lang=\"EN-GB\" style=\"font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-fareast-language: EN-GB;\">Responsible for validating/endorsing the technical solution.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: .25in; line-height: 150%;\"><span lang=\"EN-GB\" style=\"font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-fareast-language: EN-GB;\">Manages the bid submission process from initial contact through contract signing; places particular emphasis on establishing the trading terms.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: .25in; line-height: 150%;\"><span lang=\"EN-GB\" style=\"font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-fareast-language: EN-GB;\">Oversees the execution of the overall bidding process regarding large, complex issues.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: .25in; line-height: 150%;\"><span lang=\"EN-GB\" style=\"font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-fareast-language: EN-GB;\">Manages the preparation of bids, proposal content, conformance to Request for Proposal (RFP) requirements, customer liaison and business partner/vendor coordination.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: .25in; line-height: 150%;\"><span lang=\"EN-GB\" style=\"font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-fareast-language: EN-GB;\">Perform the costing in coordination with the supply chain and logistics manager, marketing, finance and other internal key stakeholders.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: .25in; line-height: 150%;\"><span lang=\"EN-GB\" style=\"font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-fareast-language: EN-GB;\">Produce a comprehensive technical and commercial offer.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: .25in; line-height: 150%;\"><span lang=\"EN-GB\" style=\"font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-fareast-language: EN-GB;\">Participate/contribute to the negotiations to close the deal</span></li>\r\n</ul>','<ul>\r\n<li><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: black; mso-themecolor: text1; mso-ansi-language: EN-US;\"><span style=\"fo