 Roman\';\">&nbsp;</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11pt; font-family: Calibri, sans-serif;\">Experience working with current solar technology preferred</span></li>\r\n<li><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11pt; font-family: Calibri, sans-serif;\">Computer proficiency required, creating spreadsheets and reports using Microsoft Software Programs</span></li>\r\n<li><span lang=\"EN-GB\" style=\"font-size: 11.0pt; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB; mso-bidi-language: AR-SA;\">Use of software like HOMER, PVSyst, Helioscope, Schneider CONNEXT designer is mandatory after a training period if not known at the time of recruitment.</span></li>\r\n</ul>','Senior','Full time',4,'Nigeria','Lagos','',NULL,14,NULL,50,50,'NGN',0,0,20,1,'2018-04-11 09:39:39','2018-04-30',6,'Active',47,'2018-04-11 09:39:39','2018-04-19 16:26:41'),('Testing','Testing ','<p>Testing</p>','<p>Testing</p>','Manager','Part time',1,'Nigeria','Lagos','<p>Testing</p>',NULL,11,NULL,50,50,'USD',10000,50000,1,1,'2018-04-13 06:28:21','2018-04-16',14,'Active',49,'2018-04-12 11:31:23','2018-04-18 02:58:58'),('Retail Store Manager','One of our clients in the QSR industry is looking for a retail store manager. He/she will be responsible for effectively and efficiently running the store. He/she will also ensure that the staff are properly trained in delivering excellent customer service ,handling requests and improving the financial performance of the store.','<p>Key responsibilities includes:</p>\r\n<ul>\r\n<li>Delivering staff trainning and workshops where necessary</li>\r\n<li>Efficiently handling customer and staff complaints</li>\r\n<li>Monitor and improve the financial performance of the store</li>\r\n<li>Monitor and manage inventory levels to prevent stock-out</li>\r\n<li>Preparing comprehensive,relevant&nbsp; and quality reports of the store</li>\r\n<li>Manage&nbsp; budgets&nbsp;</li>\r\n<li>Overall management and control of the store</li>\r\n</ul>','<p>Bachelor\'s degree</p>\r\n<p>A minimum of 3 years cognate experience in relevant fields</p>','Manager','Full time',13,'Nigeria','Lagos','<p>Must be a good leader</p>\r\n<p>Excellent communication and managerial skill</p>\r\n<p>&nbsp;</p>',NULL,4,NULL,50,50,'NGN',150000,150000,1,1,'2018-04-18 14:56:04','2018-05-17',6,'Active',53,'2018-04-18 09:50:47','2018-04-19 16:26:14'),('Graduate Trainee',' Are you willing to gain invaluable business perspective that opens up countless opportunities for personal and professional growth? Can you offer ideas about how businesses could improve their operations and cope with the ever-evolving business landscape? Get Qualified is seeking to hire young, smart and driven graduates who will be part of a dynamic team and who aspire to pursue a career in his/her field of study.\r\n ','','<ul>\r\n<li>Show adaptability, willingness to learn new skills and commitment to exceptional delivery</li>\r\n<li>Excellent interpersonal skills and networking skills</li>\r\n<li>First degree in any field, HND or it\'s equivalent</li>\r\n<li>Proficienct in Excel</li>\r\n<li>Have a mature personality</li>\r\n<li>Fast learner with strong oral and written skills, organisational and problem solving skills</li>\r\n<li>Must be confident and possess leadership skills</li>\r\n<li>Must be a self-starter</li>\r\n<li>Great analytical skills</li>\r\n<li>Below 27 years old</li>\r\n<li>Pays attention to detail and seeks continuous improvement</li>\r\n<li>Be about to complete or must have completed the National Youth Service Corps (NYSC) scheme</li>\r\n</ul>','Entry','Full time',15,'Nigeria','lagos','<ul>\r\n<li>At least 2&nbsp; years of relevant work experience</li>\r\n<li>Business acumen</li>\r\n</ul>',NULL,69,NULL,50,50,'',0,0,92,1,'2018-04-19 11:07:51','2018-05-31',16,'Active',54,'2018-04-18 16:50:58','2018-04-20 09:19:42');
